import './style.css';
import WorkShop from './WorkShop.js';

export default function App() {
  return (
    <div>
      <h1 style={{ textAlign:'center' }}>Hello English Geeks!</h1>
      <div>
        <WorkShop material='sample1' />
      </div>
    </div>
  );
}
